/// The GraphemeBreak attribute for Unicode code-points.
#[derive(Debug,Clone,Copy,PartialEq)]
pub enum GraphemeBreak {
    Other = 0,
    Control = 1,
    Lf = 2,
    Cr = 3,
    Extend = 4,
    Prepend = 5,
    SpacingMark = 6,
    L = 7,
    V = 8,
    T = 9,
    Zwj = 10,
    Lv = 11,
    Lvt = 12,
    RegionalIndicator = 13,
}

/// Get the GraphemeBreak attribute for a Unicode code-point.
///
/// # Arguments
///  - `code_point` A code-point in the form of a rust `char`.
///
/// # Returns
/// A GraphemeBreak attribute of the Unicode code-point.
#[must_use] pub const fn get_grapheme_break(code_point: char) -> GraphemeBreak
{
    const INDEX_MASK : usize = (1 << GRAPHEME_BREAK_INDEX_BITS) - 1;
    const COLUMN_MASK : usize = (1 << GRAPHEME_BREAK_COLUMN_BITS) - 1;

    let code_point_value = code_point as usize;
    let code_point_lo = code_point_value % GRAPHEME_BREAK_CHUNK_SIZE;
    let mut code_point_hi = code_point_value / GRAPHEME_BREAK_CHUNK_SIZE;
    if code_point_hi > GRAPHEME_BREAK_INDEX_LEN - 1 {
        code_point_hi = GRAPHEME_BREAK_INDEX_LEN - 1;
    }

    let index_offset = code_point_hi * GRAPHEME_BREAK_INDEX_BITS;
    let index_byte_offset = index_offset / 8;
    let index_bit_offset = index_offset % 8;
    let mut index: usize = 0;
    index |= (GRAPHEME_BREAK_DATA[GRAPHEME_BREAK_INDEX_BYTE_OFFSET + index_byte_offset + 1] as usize) << 8;
    index |= (GRAPHEME_BREAK_DATA[GRAPHEME_BREAK_INDEX_BYTE_OFFSET + index_byte_offset + 0] as usize) << 0;
    index >>= index_bit_offset;
    index &= INDEX_MASK;

    let column_offset = (index * GRAPHEME_BREAK_CHUNK_SIZE + code_point_lo) * GRAPHEME_BREAK_COLUMN_BITS;
    let column_byte_offset = column_offset / 8;
    let column_bit_offset = column_offset % 8;

    let mut value: usize = 0;
    value |= (GRAPHEME_BREAK_DATA[column_byte_offset + 1] as usize) << 8;
    value |= (GRAPHEME_BREAK_DATA[column_byte_offset + 0] as usize) << 0;
    value >>= column_bit_offset;
    value &= COLUMN_MASK;

    return match value {
        0 => GraphemeBreak::Other,
        1 => GraphemeBreak::Control,
        2 => GraphemeBreak::Lf,
        3 => GraphemeBreak::Cr,
        4 => GraphemeBreak::Extend,
        5 => GraphemeBreak::Prepend,
        6 => GraphemeBreak::SpacingMark,
        7 => GraphemeBreak::L,
        8 => GraphemeBreak::V,
        9 => GraphemeBreak::T,
        10 => GraphemeBreak::Zwj,
        11 => GraphemeBreak::Lv,
        12 => GraphemeBreak::Lvt,
        13 => GraphemeBreak::RegionalIndicator,
        _ => GraphemeBreak::Other,
    };
}

#[cfg(all(test, not(debug_assertions)))]
#[test]
fn grapheme_break_full_coverage()
{
    for c in '\u{0000}'..='\u{d7ff}' {
        let _ = get_grapheme_break(c);
    }
    for c in '\u{e000}'..='\u{10ffff}' {
        let _ = get_grapheme_break(c);
    }
}

